import React from 'react'

import './App.css'

import modules from './modules';

/////////////////////////////////////////////

//Main App layout
class App extends React.Component {
    render() {
        let firstName = this.props.firstName;
        let lastName = this.props.lastName;
        return (
            (<div className='app'>
                <modules.TopHeader firstName={firstName} lastName={lastName}/>
                <div id='row1'>
                    <div className='column'><modules.Schedule /></div>
                    <div className='column'><modules.Phone /></div>
                </div>
                <div id='row2'>
                    <div className='column'><modules.News firstName={firstName} lastName={lastName}/></div>
                    <div className='column'><modules.Notes /></div>
                </div>

            </div>)
        )
    }
}

export default App;
